import React, { useState, useContext } from "react";
import { useHistory, Link, withRouter } from "react-router-dom";
import PropTypes from "prop-types";

import { Nav, Container, Button, Row, Col, Form } from "react-bootstrap";
import UserContext from "../context/userContext";

import axios from "axios";
import Footer from "../components/Footer";

import Navigation from "../components/Navigation";
import "../styles/index.css";
import { Component } from "react";
import context from "react-bootstrap/esm/AccordionContext";

import Login from "../components/Login";

const Admin = () => {
  return (
    <>
      <script
        src="https://kit.fontawesome.com/a17da011a4.js"
        crossorigin="anonymous"
      ></script>
      <div className="faq-nav">
        <Navigation></Navigation>
        <div className="header-text">
          <Container>
            <Row>
              <p className="heading-about">SPEAK FRIEND AND ENTER</p>
            </Row>
          </Container>
        </div>
      </div>
      <br />
      <div>
        <Container className="fencing-body">
          <Login />
        </Container>
        <br />
        <br />
      </div>
      <Footer></Footer>
    </>
  );
};
Login.propTypes = {
  loginUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  errors: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  errors: state.errors,
});

export default withRouter(connect(mapStateToProps, loginUser)(Admin));
